script: |
  super -f text -I q8229.spq | sort > q8229.out

inputs:
  - name: q8229.spq
    data: |
      SELECT ALL + - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 88 + - col1 IN ( col1, + col0, - col2 * + - 91 );
  - name: tab1

outputs:
  - name: q8229.out
    data: |
      -51
      -85
      -91
